import React, { Component } from 'react'

export default class About extends Component {
    render() {
        const handleAboutUpdate = this.props.handleUpdate
        return (
            <button className="btn" onClick={() => handleAboutUpdate('aboutPage')}>
                About 
            </button>
        )
    }
}







